import React, { useState, useEffect } from 'react'
import { useSelector } from 'react-redux';
import { useDispatch } from 'react-redux'
import { getAllUsers } from './actions/user_actions';


function UsersList(props) {
    const dispatch = useDispatch();
    const [users, setUsers] = useState([]);
    const userId = useSelector(state => state.user_reducer.user);
    useEffect(() => {
        async function func() {
            let response = await dispatch(getAllUsers());
            setUsers(response.payload.data.users);
        }
        func();
    }, [dispatch])


    return (
        <div className="leftUsersContainer" >
            {
                users.map((user) => (
                    user._id === userId
                        ?
                        <div className="leftUserContent" key={user._id}>
                            <i className="fa fa-user-circle-o userIcon"></i>
                            <h3>{user.name}</h3>
                        </div>
                        :
                        " "

                ))
            }
        </div>
    )
}

export default UsersList
